import { LENGUAGES_MASTERED, DATABASE_MANAGEMENT_MASTERED } from "../techs/techMastered.component";

import './techCardCollection.style.css'

const TechCollection = ({className}) => {
  return(
    <div className={`techCollection_container ${className}`}>
      {
        TECH_MASTERED.map((Tech, index) => {
          return <div className="tech_container"><Tech/></div>
        })
      }
    </div>
  )
}

export default TechCollection;



